class Solution {
public:
    vector<double> averageOfLevels(TreeNode* root) {
        vector<double> res;
        if (!root) return res;

        queue<TreeNode*> q;
        q.push(root);

        while (!q.empty()) {
            int sz = q.size();
            long long sum = 0;          // avoid overflow for large trees

            for (int i = 0; i < sz; ++i) {
                TreeNode* node = q.front();
                q.pop();

                sum += node->val;
                if (node->left)  q.push(node->left);
                if (node->right) q.push(node->right);
            }
            res.push_back(static_cast<double>(sum) / sz);
        }
        return res;
    }
};

