/**
 * Definition for singly-linked list.
 * struct ListNode {
 *     int val;
 *     ListNode *next;
 *     ListNode() : val(0), next(nullptr) {}
 *     ListNode(int x) : val(x), next(nullptr) {}
 *     ListNode(int x, ListNode *next) : val(x), next(next) {}
 * };
 */
class Solution {
private:
    ListNode* middleSplit(ListNode* head){
        if(!head || !head->next) return nullptr;  // ✅ Edge case handling

        ListNode* slow = head;
        ListNode* fast = head;
        ListNode* prev = nullptr;

        while(fast && fast->next){
            prev = slow;
            slow = slow->next;
            fast = fast->next->next;
        }

        prev->next = nullptr;  // ✅ Now guaranteed to be safe
        return slow;
    }

    ListNode* merge(ListNode* list1, ListNode* list2){
        if(!list1) return list2;  // ✅ Handle nulls gracefully
        if(!list2) return list1;

        ListNode dummy(0);  // ✅ Stack allocation (minor improvement)
        ListNode* temp = &dummy;

        while(list1 && list2){
            if(list1->val <= list2->val){
                temp->next = list1;
                list1 = list1->next;
            }else{
                temp->next = list2;
                list2 = list2->next;
            }
            temp = temp->next;
        }

        temp->next = list1 ? list1 : list2;  // ✅ More concise
        return dummy.next;
    }

public:
    ListNode* sortList(ListNode* head) {
        if(!head || !head->next){
            return head;
        }

        ListNode* secondHalf = middleSplit(head);
        if(!secondHalf) return head;  // ✅ Handle edge case

        ListNode* list1 = sortList(head);
        ListNode* list2 = sortList(secondHalf);

        return merge(list1, list2);
    }
};
